import{_ as a,c as l,o as e,a5 as o}from"./chunks/framework.DG2Gnf0C.js";const q=JSON.parse('{"title":"炸了学校又炸家","description":"","frontmatter":{},"headers":[],"relativePath":"members/3-ordinaryMembers/炸了学校又炸家.md","filePath":"members/3-ordinaryMembers/炸了学校又炸家.md","lastUpdated":1758972682000}'),i={name:"members/3-ordinaryMembers/炸了学校又炸家.md"},t=o('<h1 id="炸了学校又炸家" tabindex="-1">炸了学校又炸家 <a class="header-anchor" href="#炸了学校又炸家" aria-label="Permalink to &quot;炸了学校又炸家&quot;">​</a></h1><blockquote><p>QQ用户名“我与英语亲如一家”（是因为我的英语太差了）在其他部分平台的用户名“1230days”</p></blockquote><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>目前高二，普通电教委，退役OIer，CTFer，目前涉及的领域为网络安全、Web、桌面开发、微电子、3D打印，有时候也玩一玩摄影（但是穷），喜欢捣鼓*（&quot;*&quot;为通配符），还算是在年纪比较出名，曾因在电子班牌上发布联名信签名页面然后把签名结果投到学校图书馆门口大屏上被处分。</p><h2 id="语言" tabindex="-1">语言 <a class="header-anchor" href="#语言" aria-label="Permalink to &quot;语言&quot;">​</a></h2><h3 id="精通的语言" tabindex="-1">精通的语言： <a class="header-anchor" href="#精通的语言" aria-label="Permalink to &quot;精通的语言：&quot;">​</a></h3><ul><li>目前没有</li></ul><h3 id="会一点的" tabindex="-1">会一点的： <a class="header-anchor" href="#会一点的" aria-label="Permalink to &quot;会一点的：&quot;">​</a></h3><ul><li><img src="https://img.shields.io/badge/C++-purple?style=flat-square&amp;logo=cplusplus&amp;logoColor=white" alt="C++"></li><li><img src="https://img.shields.io/badge/Python-blue?style=flat-square&amp;logo=Python&amp;logoColor=white" alt="Python"></li><li><img src="https://img.shields.io/badge/HTML5-red?style=flat-square&amp;logo=html5&amp;logoColor=white" alt="HTML5"> <img src="https://img.shields.io/badge/CSS3-blue?style=flat-square&amp;logo=css3&amp;logoColor=white" alt="CSS3"> <img src="https://img.shields.io/badge/JavaScript-yellow?style=flat-square&amp;logo=JavaScript&amp;logoColor=white" alt="JavaScript"></li><li><img src="https://img.shields.io/badge/PHP-blue?style=flat-square&amp;logo=PHP&amp;logoColor=white" alt="PHP"></li></ul><h3 id="不怎么会的-快忘没了的" tabindex="-1">不怎么会的（快忘没了的）： <a class="header-anchor" href="#不怎么会的-快忘没了的" aria-label="Permalink to &quot;不怎么会的（快忘没了的）：&quot;">​</a></h3><ul><li><img src="https://img.shields.io/badge/VB.NET-purple?style=flat-square&amp;logo=VB&amp;logoColor=white" alt="VB.NET"></li><li><img src="https://img.shields.io/badge/SQL-blue?style=flat-square&amp;logo=SQL&amp;logoColor=white" alt="SQL"></li></ul><h2 id="写过的项目" tabindex="-1">写过的项目 <a class="header-anchor" href="#写过的项目" aria-label="Permalink to &quot;写过的项目&quot;">​</a></h2><p>目前没有什么大的开源项目，只是自己写了一些玩具，有时只是为了得个奖。</p><h2 id="正在进行的项目" tabindex="-1">正在进行的项目 <a class="header-anchor" href="#正在进行的项目" aria-label="Permalink to &quot;正在进行的项目&quot;">​</a></h2><h3 id="liquidcontrol" tabindex="-1">LiquidControl <a class="header-anchor" href="#liquidcontrol" aria-label="Permalink to &quot;LiquidControl&quot;">​</a></h3><p>大概与“机房管理助手”类似，但更加现代，目前使用C++加Python编写，期望引入插件系统和集控系统。</p><h5 id="关于liquidcontrol-一些废话如下" tabindex="-1">关于LiquidControl， 一些废话如下 <a class="header-anchor" href="#关于liquidcontrol-一些废话如下" aria-label="Permalink to &quot;关于LiquidControl， 一些废话如下&quot;">​</a></h5><blockquote><p>随着教育信息化的发展，越来越多的课堂依赖于信息机房开展，但计算机的使用以极其容易用于娱乐的特性，为课堂管理带来了很大的难度。现有的电子教室软件较为脆弱，难以阻止学生脱离控制，而市面上现有的增强控制软件。一般使用较老的技术，也难以阻挡破解软件。于是我想要开发了LiquidControl这一课堂管理软件。Liquid意为液体，代表LiquidControl更加接近系统底层，像液体一样渗入系统文件已组建消弭于无声，控制于无形。LiquidControl在接近系统底层的同时，使用RSA等现代加密技术，通过哈希、数字签名、非对称加密的方式，增强其防篡改能力。核心组件采用分布式设计，多冗余，多备份，全息化，极大提高了系统的鲁棒性。</p></blockquote><h2 id="设备" tabindex="-1">设备 <a class="header-anchor" href="#设备" aria-label="Permalink to &quot;设备&quot;">​</a></h2><ul><li>HUAWEI P50</li><li>HUAWEI Matebook X Pro 2022</li><li>树莓派 4B</li><li>Canon 700D</li><li>aliyun 99 一年服务器</li></ul><h2 id="域名" tabindex="-1">域名 <a class="header-anchor" href="#域名" aria-label="Permalink to &quot;域名&quot;">​</a></h2><ul><li>正在买，实名认证审核中。</li></ul>',22),r=[t];function s(h,d,n,u,c,m){return e(),l("div",null,r)}const b=a(i,[["render",s]]);export{q as __pageData,b as default};
